import React, { useState } from 'react';

const AddLaundererModal = () => {
  const [launderer, setLaunderer] = useState('');

  const onChange = (e) => {
    console.log(e.target.value);
    // setLaunderer();
  };

  return (
    <div id='add-launderer-modal' className='modal'>
      <div className='modal-content'>
        <h4>Fill Launderer Name</h4>
        <div className='row'>
          <form className='col s12'>
            <div className='row'>
              <div className='input-field col s6'>
                <input id='first_name' type='text' onChange={onChange} />
                <label htmlFor='first_name'>First Name</label>
              </div>
              <div className='input-field col s6'>
                <input id='last_name' type='text' />
                <label htmlFor='last_name'>Last Name</label>
              </div>
            </div>
          </form>
        </div>
      </div>
      <div className='modal-footer'>
        <a href='#!' className='modal-close waves-effect waves-green btn'>
          Submit
        </a>
      </div>
    </div>
  );
};

export default AddLaundererModal;
